import React, {useState, useEffect} from 'react';
import { TextField } from '@material-ui/core';
import { Button } from '@material-ui/core';
import axios from 'axios';





const Title1 = {
  fontSize: '20px',
  color: '#008037',
  fontWeight: 'bold',
  marginLeft: '20px',
  justifyContent: 'center'
}
const Field = {
  marginLeft: '20px',
  width: '500px',
  marginTop: '25px',
  padding :'15px',
 

}
const buttonstyle = {
  marginLeft: '150px',
  marginTop: '50px',
  backgroundColor: '#008037' ,
  width: '80px',
  borderRadius: '5px'
  
 
 
}
const PartnersUpdate = () => {
const [data, setData] = React.useState({
  error: '',
  data: [],
  temp: [],
  error: null,
 

});
const handleEdit = () => {
  const [partnerdata, setPartnerdata] = React.useState({
    partnerName: "",
    partnerMail: "",
    phone: "",
    city:"",
    password:""
  });
  axios.put('https://api.foodealzapi.com/restaurants', partnerdata) 

    .then((partnerdata) => {
      console.log(partnerdata);
    })
    .catch(error => {
      console.log(error);
    });
}



  return (
    <div >
      <div style={Title1}>
        <h2> Enter new Fields</h2>
      </div>
      <div style={Field}>
        <TextField 
          label="Enter partnerName" />
         
        <TextField style={{marginLeft: '50px'}}
          label="Enter partnerMail" />
        
      </div >
     
      
      <div style={Field}>
        <TextField
          label="Enter phone" />
      
       
        <TextField style={{marginLeft: '50px'}}
          label="Enter city" />
      </div>
    
      <div >
        <TextField style={{marginTop: '20px', marginLeft: '25px'}}
          label="Enter password" />
      </div>
     
      <div style={buttonstyle}>
        <Button variant="outline-success"  onClick={ () => this.handleEdit()} >confirmer</Button>
        </div>

    </div>

  )

};

export default PartnersUpdate;
